CREATE TABLE IF NOT EXISTS `Employee` (
    `Staff_ID` INT,
    `Staff_FName` VARCHAR(10) CHARACTER SET utf8,
    `Staff_LName` VARCHAR(10) CHARACTER SET utf8,
    `Dept` VARCHAR(11) CHARACTER SET utf8,
    `Position` VARCHAR(23) CHARACTER SET utf8,
    `Country` VARCHAR(10) CHARACTER SET utf8,
    `Email` VARCHAR(34) CHARACTER SET utf8,
    `Reporting_Manager` INT,
    `Role` INT
);
